import React from 'react';

export default class Tabela extends React.Component {
    render() {
 /*       const nomes = this.props.lista.map((pessoas, index) => 
            <tr key = {index} onContextMenu = {this.props.removerPessoa.bind(this, index)}>
                <td> {pessoas.nome} </td>
            </tr>
        ); */

        var obj = [...this.props.lista];
obj.sort((a,b) => a.timeM - b.timeM);
obj.map((item, i) => (<div key={i}> {item.timeM}</div>))

       const listPessoas = obj;

        return (
            <ol>
                { listPessoas.map(pessoa => <li>{ pessoa }</li>)}
            </ol>
        )
    }
}











